import React, { useCallback } from "react";
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

const Landing = () => {
  const particlesInit = useCallback(async (engine) => {
    await loadFull(engine);
  }, []);

  return (
    <div style={{ position: "relative", height: "100vh", overflow: "hidden" }}>
      {/* Particles Background */}
      <Particles
        id="tsparticles"
        init={particlesInit}
        options={{
          background: { color: { value: "#000" } },
          fpsLimit: 60,
          particles: {
            number: { value: 200, density: { enable: true, value_area: 800 } },
            color: { value: "#ffcc00" },
            shape: { type: "circle" },
            opacity: { value: 0.5, random: true },
            size: { value: 3, random: { enable: true, minimumValue: 1 } },
            move: { enable: true, speed: 2 },
          },
          detectRetina: true,
        }}
        style={{
          position: "absolute",
          zIndex: -1, // Keep it behind everything
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
        }}
      />

      {/* Content Wrapper with z-index */}
      <div style={{ position: "relative", zIndex: 2, textAlign: "center", color: "white" }}>
        {/* Navbar */}
        <nav className="navbar" style={{ padding: "20px", fontSize: "24px" }}>
          <span>Home</span>
          <span style={{ marginLeft: "20px" }}>Login</span>
          <span style={{ marginLeft: "20px" }}>Sign Up</span>
        </nav>

        {/* Website Title */}
        <h1 className="website-title" style={{ marginTop: "50px", fontSize: "40px" }}>
          Welcome to Hungry Hault
        </h1>
      </div>
    </div>
  );
};

export default Landing;
